import './style.css'

const Panel = (props) => {
   return (
      <div className='panel-wrap'>
         <div className='input-wrap'>
            <input className='panel-input panel-input-path' />
         </div>

         <input className='panel-input panel-input-newValue' />
         <button className='panel-button'>Применить</button>

      </div>
   )
}

export default Panel
